import React from 'react';
import './ImageSlider.css';

const ImageSlider = () => {
  return (
    <div className="slider-container">
      <div className="slide">
        <img src="https://images.pexels.com/photos/262508/pexels-photo-262508.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Image 1" />
      </div>
      <div className="slide">
        <img src="https://images.pexels.com/photos/267569/pexels-photo-267569.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Image 2" />
      </div>
      <div className="slide">
        <img src="https://images.pexels.com/photos/261579/pexels-photo-261579.jpeg?auto=compress&cs=tinysrgb&w=400" alt="Image 3" />
      </div>
    </div>
  );
};

export default ImageSlider;
